import React , {Component} from "react"
import Header from "components/Header/Header.jsx";


class Landingpage extends Component {
    render(){
        return(
            <div>
                    <Header
          color="transparent"
          brand="Material Kit React"
          rightLinks={<HeaderLinks />}
          fixed
          changeColorOnScroll={{
            height: 200,
            color: "white"
          }}

        />
            </div>

        );
    }
}

export default Landingpage ;
